    lines observed and reported in the open literature for 121 diatomic molecules through
    July 2002. The isotopic molecular species, assigned quantum numbers, observed frequency,
    estimated measurement uncertainty, and reference are given for each transition reported.
    Derived molecular properties, such as rotational constants, hyperfine structure
    constants, electric dipole moments, rotational g-factors and internuclear distances,
    are listed with one standard deviation uncertainties for all species.",nt"license_title":
